import React from 'react';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Image from 'react-bootstrap/Image';
import fotoPerfil from './foto.jpg';

export default function Foto(){
    return (
        <div>
          
              <Row className="justify-content-md-center">
                    <Col xs lg="5" style={{ alignItems:'flex-end'}}>
                       <h1 style={{fontSize:'80px',fontFamily:'sans-serif',fontStyle:'italic',color:'#52BE80'}}>Rafaela Viana</h1>
                       <h4 style={{fontSize:'40px', color:'#641E16'}}>Programadora Web</h4>
                    </Col>
                    <Col md="auto" style={{ padding: '50px' }}></Col>
                    <Col xs lg="2">
                        <Image src={fotoPerfil} roundedCircle style={{ backgroundColor:'#D4EFDF',boxShadow:'0px 20px 80px -22px rgba(0,0,0,0.84)' }}/>
                    </Col>
                </Row>
            
        </div>
    )

}
